Back Issue #70 examines the Incredible Hulk in the Bronze Age - including looks into Hulk's mind, his role as a team player, the Incredible Hulk TV show and cartoon, Hulk merchandising, the Hulk newspaper strip, Teen Hulk, and a villain history of the Abomination! Exploring the work of Sal Buscema, John Byrne, Peter David, Kenneth Johnson, Bill Mantlo, Al Milgrom, Earl Norem, Roger Stern, Herb Trimpe, Len Wein, and more. Featuring an all-new Hulk vs. Wolverine in Canada cover by Herb Trimpe and Gerhard! Edited by Michael Eury.

